1. Высококвалифицированная консультация клиентов для выявления потребности и подбора альтернативных источников энергии (АИЭ);
 2. Профессиональный монтаж и своевременно выполненный эффективный сервис АИЭ;
 3. Разработка и производство электронных контроллеров для обеспечения экологичного и контролируемого процесса сгорания твердого топлива в твердотопливных котлах.
